import React, { Component } from "react";
import DetailCard from "../Presentation/DetailCard";

export default class GigsList2 extends Component {
  state = { gigs: [] };

  componentDidMount() {
    fetch("http://localhost:8088/gigs")
      .then(e => e.json())
      .then(gigs => this.setState({ gigs: gigs }));
  }

  render() {
    return (
      <React.Fragment>
        {this.state.gigs.map(gig => (
          <DetailCard id={gig.id} name={gig.name} resource="gigs" />
        ))}
        <section className="section-content">
          <button
            type="button"
            className="btn"
            onClick={() => {
              this.props.history.push("/venues/new");
            }}
          >
            Add Venue
          </button>
        </section>
      </React.Fragment>
    );
  }
}
